//
//   Play startup tone
//

function playStartupTone() {

   // Base64-encoded representation of Startup.wav file
   const wavBase64 = 'data:audio/wav;base64,';

   // Create an audio element
   const audio = new Audio(wavBase64);

   // Play the audio
   audio.play();

}


